import { Modal, ModalHeader, ModalBody, ModalFooter, Spinner,TabContent, TabPane, Nav, NavItem, NavLink, Card,CardImg, Button, CardTitle, CardBody, CardText, Row, Col, Container } from 'reactstrap';
import React, {useState} from 'react';
import classnames from 'classnames';
class Diagnosis extends React.Component{
	constructor(props){
		super(props);
		this.state = {
		}
	}
  downloadHandler(media){
    this.props.downloadHandler(media);
  }

	render(){
		return(
			<div>
				{this.props.currentState.showModalDiagnosis && 
          <ModalDiagnosis handlerSuper={()=>{this.props.handler("OnConnection")}} 
                          thumbnail={this.props.thumbnail} 
                          getScreenshots={()=>this.props.getScreenshots()}
                          downloadHandler={(media)=> this.downloadHandler(media)}/>}
			</div>
		);
	}
}

const ModalDiagnosis= (props) => {
  const {
    className,
    thumbnail,
    getScreenshots, 
    downloadHandler
  } = props;

  const [modal, setModal] = useState(true);

  const toggle = () => {
  	setModal(!modal);
		props.handlerSuper();
	}

	const [activeTab, setActiveTab] = useState('1');
  const toggle2 = tab => {
    if(activeTab !== tab) setActiveTab(tab);
  }
  return (
    <div>
      <Modal isOpen={modal} toggle={toggle} className={className} size={'xl'} style={{height: "100px"}}>
				<ModalBody>
					<Nav tabs>
						<NavItem>
							<NavLink className={classnames({ active: activeTab === '1' })}
											 onClick={() => { toggle2('1'); }}>
											 Diagnostico
							</NavLink>

						</NavItem>

						<NavItem>
							<NavLink className={classnames({ active: activeTab === '2' })}
											 onClick={() => { toggle2('2'); }}>
								       Descargas
							</NavLink>
						</NavItem>
              <div style={{position: 'absolute', height: "500px"}}></div>
					</Nav>

					<TabContent activeTab={activeTab}>
						<TabPane tabId="1">
							<DiagnosisTab />
						</TabPane>
						<TabPane tabId="2">
							<DownloadTab thumbnail={thumbnail} getScreenshots={getScreenshots} downloadHandler={downloadHandler}/>
						</TabPane>
					</TabContent>

        </ModalBody>
      </Modal>
    </div>
  );
}
function DiagnosisTab(){
	return(
		<Spinner color="info" style={{position:'absolute',margin:'auto'}} size={'xl'}/>
	);
}
const DownloadTab = (props) => {
  const{
    thumbnail,
    getScreenshots,
    downloadHandler,
  }=props;

  let screenshots = getScreenshots.call();
  let  screenshotsIsEmpty = (screenshots.length === 0)? true:false;
	return(
		<Container>
			<Row>
      	<Col sm="6">
          <Card body>
            <CardImg top width="100%" src= {thumbnail} alt="thumbnail" />
            <CardText>Grabaci√≥n del examen.</CardText>
            <Button color='primary' onClick={()=>{downloadHandler("video")}}> Descargar Video</Button>
          </Card>
        </Col>
        {!screenshotsIsEmpty &&
        <Col sm="6">
          <Card body>
            <CardImg top width="100%" src= {screenshots[0].src} alt="thumbnail" />
            <CardText>Capturas de Pantalla.</CardText>
            <Button color='primary' onClick={()=>{downloadHandler("screenshots")}}>Descargar capturas</Button>
          </Card>
        </Col>
        }
     </Row>
		</Container>
	);
}
export default Diagnosis;
